benchmarks.TrackingSuite.track_prime_cou.code:
class TrackingSuite:
    def track_prime_count(self):
        """Track count of prime numbers up to 100"""
        def is_prime(n):
            if n < 2:
                return False
            for i in range(2, int(n ** 0.5) + 1):
                if n % i == 0:
                    return False
            return True

        return sum(1 for i in range(2, 100) if is_prime(i))
